import React from 'react';
import './mainImageContent.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faEnvelope, faShare} from "@fortawesome/free-solid-svg-icons";

const mainImageContent = () => {
    return ( 
        <div className={'MainImageContent'}>
            <h3>This is our great company.</h3>
            <FontAwesomeIcon icon={faShare} className="fa-3x" style={{zIndex: '50', color: 'white', margin: 8}} />
            <FontAwesomeIcon icon={faEnvelope} className="fa-3x" style={{zIndex: '50', color: 'white', margin: 8}} />
        </div>
     );
}

export default mainImageContent;
